var out = {
    palettes: [],
    setTypes: []
};

obj.figuredata.colors.palette.forEach(p => {
    var palette = {
        id: p._id,
        colors: []
    };

    p.color.forEach(c => {
        palette.colors.push({
            id: parseInt(c._id),
            club: c._club == "1",
            selectable: c._selectable == "1",
            color: "#" + c.__text
        });
    })

    out.palettes.push(palette);
})

obj.figuredata.sets.settype.forEach(st => {
    var setType = {
        type: st._type,
        paletteId: st._paletteid,
        mandatory: st._mandatory == "1",
        sets: []
    };

    st.set.forEach(s => {
        var parts = [];

        if (Array.isArray(s.part)) {
            s.part.forEach(p => {
                parts.push({
                    id: parseInt(p._id),
                    type: p._type,
                    colorable: p._colorable == "1",
                    index: parseInt(p._index)
                });
            });
        } else {
            parts.push({
                id: parseInt(s.part._id),
                type: s.part._type,
                colorable: s.part._colorable == "1",
                index: parseInt(s.part._index)
            });
        }

        var hiddenLayers = [];

        if (s.hiddenlayers) {
            if (Array.isArray(s.hiddenlayers.layer)) {
                s.hiddenlayers.layer.forEach(l => {
                    hiddenLayers.push(l._parttype);
                });
            } else {
                hiddenLayers.push(s.hiddenlayers.layer._parttype);
            }
        }

        setType.sets.push({
            id: parseInt(s._id),
            gender: s._gender,
            club: s._club == "1",
            colorable: s._colorable == "1",
            selectable: s._selectable == "1",
            parts: parts,
            hiddenLayers: hiddenLayers
        });
    });

    out.setTypes.push(setType);
});
